{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/nanthaporn/capstone-bellabeat-case-study?scriptVersionId=137922180\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"fa878741","metadata":{"papermill":{"duration":0.009277,"end_time":"2023-07-26T04:28:04.869351","exception":false,"start_time":"2023-07-26T04:28:04.860074","status":"completed"},"tags":[]},"source":["# **Bellabeat Case Study**\n","This case study is hands-on activities for Grow with Google’s Data Analytics certificate intended for educational purposes in answering business tasks. All data used by the author is from [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit) (CC0: Public Domain, dataset made available through Mobius). According to the details of scenario as follows:\n","\n","**Given Scenario**: You are a junior data analyst working on the marketing analyst team at Bellabeat, a high-tech manufacturer of health-focused products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company. You have been asked to focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights you discover will then help guide marketing strategy for the company. You will present your analysis to the Bellabeat executive team along with your high-level recommendations for Bellabeat’s marketing strategy\n","\n","To answer business tasks, I will follow the steps of the data analysis process: **ask**, **prepare**, **process**, **analyze**, **share**, and **act**.\n","\n","# 1. Ask\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?\n","\n","# 2. Prepare\n","I decide to apply the publicly available FitBit Fitness Tracker Data that explores existing smart device users’ daily habits as a reference to discover trends in smart device use and incorporate them into Bellabeat’s marketing strategy.\n","\n","# 3. Process\n","With the certain limitation and huge amount of data entries, I therefore choose the R language programming to use for this processing and analyzing.\n","\n","## 3.1 Upload raw data file into RStudio\n","* dailyAcitivity_merged\n","* sleepDay_merged\n","* weightLogInfo_merged.csv\n","\n","## 3.2 Use the `install.packages()` and `library()` functions to install and load packages once for all following steps of the entire case study"]},{"cell_type":"code","execution_count":1,"id":"9e6989ab","metadata":{"execution":{"iopub.execute_input":"2023-07-26T04:28:04.891339Z","iopub.status.busy":"2023-07-26T04:28:04.888351Z","iopub.status.idle":"2023-07-26T04:29:05.246982Z","shell.execute_reply":"2023-07-26T04:29:05.244014Z"},"papermill":{"duration":60.380128,"end_time":"2023-07-26T04:29:05.257566","exception":false,"start_time":"2023-07-26T04:28:04.877438","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Warning message:\n","“unable to access index for repository http://cran.rstudio.com/src/contrib:\n","  cannot open URL 'http://cran.rstudio.com/src/contrib/PACKAGES'”\n","Warning message:\n","“package ‘tidyverse’ is not available for this version of R\n","\n","A version of this package for your version of R might be available elsewhere,\n","see the ideas at\n","https://cran.r-project.org/doc/manuals/r-patched/R-admin.html#Installing-packages”\n"]}],"source":["install.packages(\"tidyverse\")"